import React from "react";
import "./WhatWeDoData";
import "./css/WhatWeDo.css";
import { data } from "./WhatWeDoData";

function WhatWeDo() {
  return (
    <div className="what__we__do">
      <div className="WhatWeDo__header">
        <h1>What we do?</h1>
      </div>
      {data.map(({ path, title, link, text }) => (
        <div className="whatWeDo__activity">
          <div
            className="whatwedo__image__container"
            style={{ backgroundImage: `url(${path})` }}
          >
            <img src={path} alt="" className="whatwedo__image" />
          </div>
          <div className="whatwedo__title">{title}</div>
          <div className="whatwedo__text">{text}</div>
          <div className="whatwedo__link">{path}</div>
        </div>
      ))}
    </div>
  );
}

export default WhatWeDo;
